import { StatusBar } from "expo-status-bar";
import React from "react";

import { Container, BG } from "./styles";
import Background from "./assets/background.jpg";
export default function App() {
  return (
    <Container>
      <BG>
        <Image source={Background} />
      </BG>
    </Container>
  );
}
